                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          In order to call a subscriber to the public national
                          fixed or mobile telecommunication networks (local or
                          national call), a number in the format SABPQMCDU is
                          used.
                  - type: paragraph
                    content:
                      - type: text
                        marks:
                          - type: strong
                        text: III) Calls to emergency services
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          The numbers used to contact one of the emergency
                          services (two or three digits) from within the country
                          take the following format:
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_\_ 1X - where \_\_\_\_\_\_ X = 8 fire service and X = 7 police"
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          These services cannot be called from outside the
                          country.
                  - type: paragraph
